import React from "react";
import useProtectedData from "./useProtectedData";

const UserList = () => {
  const {
    data: users,
    loading,
    error,
  } = useProtectedData("http://localhost:5000/users");

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div style={{ color: "red" }}>Failed to fetch users</div>;
  }

  return (
    <div>
      <h1>User List</h1>
      <ul>
        {users.map((user, index) => (
          <li key={index}>{user.name}</li> // assuming each user object has a "name" property
        ))}
      </ul>
    </div>
  );
};

export default UserList;
